%{
#include "list-functions.c"
#define PRIME 31


struct header
 {int coll;
  struct node * list;
};



int hashval;
struct header htable[PRIME];
char name[20] ;
int count = 0;

void displaytable (struct header * ht)
  {
    for ( int i = 0; i < PRIME ; i++ )
    {  if (ht[i].coll != 0)
        { printf ( " *************************************** \n");
         printf ( " No of elements at index %d = %d \n", i, ht[i].coll);
         struct node * p = ht[i].list;
         if ( p != 0 ) // traverse the nonempty list
         { printf(" At index %d ", i);
          display(p); printf("\n");
         };
        }
    }
}


int hashpjw(char* s)
{ char* p;
  unsigned h =0, g;
  for ( p = s; *p != '\0'; p = p + 1 )
  { h = ( h << 4 ) + ( *p );
    if (g = h&0xf0000000)   { h = h^(g << 24) ;  h = h ^ g;}
  }
  return h % PRIME;
}


void insertId(char* name){
      hashval = hashpjw(name);
      if (htable[hashval].list  == 0 ) // empty list, so insert
      { htable[hashval].list = (struct node*) malloc(sizeof(struct node));
        struct node * p = htable[hashval].list;
        strcpy(p->name, name);
        p->next = 0;
        p->occurrences=1;
        htable[hashval].coll ++;
      }
      else
      { // search in list pointed to by p - if not present, then add at head
        struct node * p = htable[hashval].list;
        if ( ! find(p, name))
        {   insert(&htable[hashval].list, name);
            htable[hashval].coll ++;
        };
      };
      count ++;

}


%}

