// Public class methods for statistic generation. 
int Stats::minimum()
{
	// Fail if dataset is empty.
	if (counter == 0)
		return 0;

	return numberList[0];
}


int Stats::maximum()
{
	// Fail if dataset is empty. 
	if (counter == 0)
		return 0;
	return numberList[counter - 1];
}


int Stats::sum()
{
	// Fail if dataset is empty. 
	if (counter == 0)
		return 0;

	int sum = 0;
	for (int i = 0; i < counter; i++)
		sum += numberList[i];
	return sum;
}


int Stats::mean()
{
	// Fail if dataset is empty.
	if (counter == 0)
		return 0;

	int sum = 0;
	int average = 0;
	for (int i = 0; i < counter; i++)
		sum += numberList[i];
	average = sum / counter;
	return average;
}


int Stats::median()
{
	// Fail if dataset is empty.
	if (counter == 0)
		return 0; 

	// If counter is odd, we can return middle.
	if (counter % 2 != 0)
		return numberList[counter / 2];

	int midRight = numberList[counter / 2];
	int midLeft = numberList[midRight - 2]; 
	return (midRight + midLeft) / 2;
}


